<!DOCTYPE html>
<html lang="pt-BR">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Servidor TN</title>
    <style>
        /* Estilo geral */
        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }

        body {
            font-family: 'Arial', sans-serif;
            background-color: #2c2f33;
            color: #fff;
            display: flex;
            flex-direction: column;
            align-items: center;
            justify-content: center;
            min-height: 100vh;
        }

        /* Cabeçalho */
        header {
            background-color: #23272a;
            width: 100%;
            padding: 20px 0;
            text-align: center;
            box-shadow: 0 2px 5px rgba(0, 0, 0, 0.5);
        }

        header img {
            width: 80px;
        }

        /* Conteúdo principal */
        main {
            text-align: center;
            padding: 40px;
            background-color: #36393f;
            border-radius: 10px;
            box-shadow: 0 4px 10px rgba(0, 0, 0, 0.6);
            max-width: 600px;
            width: 90%;
        }

        main h1 {
            font-size: 2.5rem;
            margin-bottom: 20px;
        }

        main p {
            font-size: 1.2rem;
            margin-bottom: 30px;
        }

        /* Botão de interação */
        .button-container button {
            background-color: #7289da;
            border: none;
            color: #fff;
            font-size: 1.2rem;
            padding: 15px 40px;
            border-radius: 5px;
            cursor: pointer;
            transition: all 0.3s ease;
        }

        .button-container button:hover {
            background-color: #ff0;
            color: #0f0;
            box-shadow: 0 0 20px #ff0, 0 0 20px #0f0;
        }

        /* Rodapé */
        footer {
            margin-top: 20px;
            text-align: center;
            font-size: 0.9rem;
            color: rgba(255, 255, 255, 0.7);
        }

        footer a {
            color: #fff;
            text-decoration: none;
            transition: color 0.3s ease;
        }

        footer a:hover {
            color: #ff0;
        }
    </style>
</head>
